import React from 'react';
import '../stylesheets/home.css';
import store from "../store";




console.log(store.getState())

const Tasks = (store, list) => store.getState()[list].map(i =>
    <li>{i}</li>
)
const TaskLists = (store) => store.getState().ToDoLists.map(i =>
    <li>
        <button type="button" className="btn btn-dark">{i}</button>
    </li>
)

function Home() {
    return (
        <div className="home">
            <div className="sidebar">
                    <button type="button" className="btn btn-dark">Home</button>
                    {TaskLists(store)}
            </div>
            <ol>
                {Tasks(store, "todos")}
            </ol>
        </div>
    );
}

export default Home;
